import React from 'react';
import classes from './UserList.module.css';
import UserItem from './UserItem/UserItem';



const userList = props => {

    let users = [];
    for(let i = 0; i < 5; ++i) {
        users.push(<UserItem/>);      
    }

    return (
        <div className = {classes.UserList}>
            {users}
        </div>
    );
};

export default userList;
